import React from 'react';
import {motion,useSpring} from 'framer-motion';
const Header=()=>{
   const springAnimation = useSpring({
      x: '0px',
      y: '0px',
      rotate: [0, 10, 0],
      transition: { duration: 1 }
    });

return(
 <header className="App-header">
   <div className='header-text'>

         <motion.div
             animate={{ x: '0px',y:'0px' ,rotate: 0,}}
             transition={{ delay:1,duration: 1,type:'spring',bounce:0.5 }}
             initial={{ x: '-50px', y:'-50px',rotate: 360}}
         >テ
         </motion.div>

         <motion.div
            initial={{ x: '0px', y:'0px',rotate: 0}}
             animate={springAnimation}
             transition={{ duration: 1 ,type:'spring',bounce: 0.7}}
         >キ
         </motion.div>

         <motion.div

         >ス
         </motion.div>

         <motion.div

         >ト
         </motion.div>

         <motion.div

         >あ
         </motion.div>

         <motion.div

         >そ
         </motion.div>

         <motion.div

         >び
         </motion.div>
   </div>
 </header>
);
}
export default Header;
